function secondsToHoursAndMinutes(seconds) {
    // Calculate hours and remaining seconds
    var hours = Math.floor(seconds / 3600);
    var remainingSeconds = seconds % 3600;

    // Calculate minutes
    var minutes = Math.floor(remainingSeconds / 60);

    return {
        hours: hours,
        minutes: minutes
    };
}

